import "core-js/modules/es.array.push.js";
import router from "@/router";
import { biller, parking, execute, getRight, authUrl } from "@/api";
import NavigationBar from "@/components/Navigation";
export default {
  name: "ParkingFleetNewSacco",
  components: {
    NavigationBar
  },
  data() {
    return {
      zone: '',
      zones: [],
      alert: {
        success: false,
        info: false,
        failed: false
      },
      incomeType: {
        incomeTypeId: null,
        incomeTypeDescription: null,
        incomeTypePrefix: null,
        fundDescription: null,
        status: null
      },
      feesAndCharges: [{
        feeId: null,
        feeDescription: null,
        unitOfMeasure: null,
        unitFeeAmount: null,
        accountNo: null,
        incomeTypeId: null,
        feeType: null,
        accountDesc: null,
        costCenterNo: null,
        zone: null,
        typeDescription: null
      }],
      incomeTypes: [{
        incomeTypeId: null,
        incomeTypeDescription: null,
        incomeTypePrefix: null,
        fundDescription: null,
        status: null
      }],
      message: null,
      download: 'Download Report',
      loading: false,
      dateFrom: '',
      dateTo: '',
      sacco: {
        saccoName: null,
        physicalAddress: null,
        fullNames: null,
        role: null,
        phoneNumber: null,
        subCounty: {
          subCountyID: null,
          subCountyName: null
        },
        ward: {
          wardID: null,
          wardName: null
        },
        zone: null,
        vehicles: [{
          numberPlate: null,
          category: null,
          owner: null,
          phoneNumber: null,
          quantity: null
        }]
      },
      subCounties: [{
        subCountyID: "",
        subCountyName: ""
      }],
      wards: [{
        wardID: "",
        wardName: ""
      }],
      subCounty: {},
      ward: {}
    };
  },
  computed: {
    totalReceiptAmount() {
      return this.formatPrice(this.receiptDetails.reduce((sum, billDetail) => sum + parseInt(billDetail.receiptAmount), 0));
    }
  },
  watch: {
    subCounty: function () {
      //Trade demographics
      this.sacco.subCounty = this.subCounty;
      this.getWards();
    },
    ward: function () {
      //Trade demographics
      this.sacco.ward = this.ward;
      this.getZones(this.ward.wardID);
    },
    zone: function () {
      this.sacco.zone = this.zone;
    }
  },
  mounted() {
    this.getSubCounties();
    this.getIncomeTypes();
    this.menuAccess();
  },
  methods: {
    menuAccess() {
      const data = new FormData();
      data.append("function", "menuAccess");
      data.append("menu", "Parking Fleet New Saccco");
      data.append("sessionNames", sessionStorage.getItem("sessionNames"));
      data.append("sessionIdNo", sessionStorage.getItem("sessionIdNo"));
      execute(data, biller).then(() => {
        // alert(res.data.message);
      }).catch(() => {
        // alert(e.message);
      });
    },
    getRight(type) {
      return getRight(type);
    },
    addVehicle() {
      this.sacco.vehicles.push({});
    },
    removeVehicle(position) {
      this.sacco.vehicles.splice(position, 1);
    },
    selectedIncomeType(event) {
      const value = event.target.value;
      const result = JSON.parse(value);
      this.getFeesAndChargesBilling(result.incomeTypeId);
    },
    getIncomeTypes() {
      const data = new FormData();
      data.append("function", "getIncomeTypes");
      data.append("incomeTypePrefix", "PKN");
      execute(data, biller).then(res => {
        if (res.data.success) {
          this.incomeTypes = res.data.data.incomeTypes;
        } else {
          this.message = res.data.message;
        }
      }).catch(e => {
        this.message = e.message;
      });
    },
    getFeesAndChargesBilling(incomeTypeId) {
      const data = new FormData();
      data.append("function", "getFeesAndCharges");
      data.append("incomeTypeId", incomeTypeId);
      execute(data, biller).then(res => {
        if (res.data.success) {
          this.feesAndCharges = res.data.data.feesAndCharges;
        } else {
          this.message = res.data.message;
        }
      }).catch(e => {
        this.message = e.message;
      });
    },
    addSacco() {
      this.message = "Please wait...";
      this.alert.failed = false;
      this.alert.info = true;
      const data = new FormData();
      data.append("function", "addSacco");
      data.append("sacco", JSON.stringify(this.sacco));
      data.append("sessionNames", sessionStorage.getItem("sessionNames"));
      data.append("sessionIdNo", sessionStorage.getItem("sessionIdNo"));
      execute(data, parking).then(res => {
        if (res.data.success) {
          this.message = res.data.message;
          this.alert.success = true;
          this.gotTo('parking-fleet');
        } else {
          this.alert.failed = true;
          this.message = res.data.message;
        }
      }).catch(e => {
        this.message = e.message;
      });
    },
    totalAmount(amount, months) {
      // Convert amount and months to numbers before multiplying
      amount = Number(amount);
      months = Number(months);
      // Return the result of multiplication
      return amount * months;
    },
    //#########
    getSubCounties() {
      const data = new FormData();
      data.append("function", "getSubCounty");
      execute(data, biller).then(res => {
        if (res.data.success) {
          this.subCounties = res.data.data.subCounties;
        } else {
          this.message = res.data.message;
        }
      }).catch(e => {
        this.message = e.message;
      });
    },
    getWards() {
      this.wards = [];
      const data = new FormData();
      data.append("function", "getWards");
      data.append("subCountyID", this.subCounty.subCountyID);
      execute(data, biller).then(res => {
        if (res.data.success) {
          this.wards = res.data.data.wards;
        } else {
          this.message = res.data.message;
        }
      }).catch(e => {
        this.message = e.message;
      });
    },
    getZones(wardID) {
      this.zones.splice(0);
      const data = new FormData();
      data.append("function", "getZones");
      data.append("wardID", wardID);
      execute(data, authUrl).then(res => {
        if (res.data.success) {
          this.zones = res.data.data.zones;
        } else {
          this.message = res.data.message;
        }
      }).catch(e => {
        //alert(e.message);
        this.message = e.message;
      });
    },
    getCurrentMonth() {
      const d = new Date();
      const monthName = this.monthNames[d.getMonth()];
      console.log(monthName);
      return monthName;
    },
    getMonthName() {
      const monthNames = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'];
      const d = new Date();
      const monthName = monthNames[d.getMonth()];
      console.log(monthName);
      return monthName;
    },
    getCurrentYear() {
      const date = new Date();
      const currentYear = date.getFullYear();
      console.log(currentYear); // Output: 2023
      return currentYear;
    },
    formatPrice(value) {
      var formatter = new Intl.NumberFormat('en-US', {
        style: 'currency',
        currency: 'KES',
        minimumFractionDigits: 2
      });
      return formatter.format(value);
    },
    gotTo(route) {
      router.push(route);
    }
  }
};
